import "./table.css"
import { useSelector } from 'react-redux';

const Table = () => {
    const posts = useSelector((state) => state.posts);
    return(
        <>
        
            <div className="App">
            <table>
                <tr>
                <th>First Name</th>
                <th>Last Name</th>
                <th>CNIC</th>
                <th>Work</th>
                <th>Contact</th>
                <th>Salary</th>
                <th>Description</th>
                </tr>

                {posts.map((post) => {
                return (
                    <tr key={key}>
                    <td>{post.firstName}</td>
                    <td> {post.lastName}</td>
                    <td> {post.cnic}</td>
                    <td> {post.work}</td>
                    <td> {post.contact}</td>
                    <td> {post.salary}</td>
                    <td> {post.description}</td>
                    </tr>
                )
                })}
            </table>
            </div>

        </>
    );
}

export default Table;
